es Bleus” tan biến. Nước mắt đã rơi trên gương mặt những CĐV tội nghiệp ở sân Allianz Arena.\n\nTuyển Pháp gục ngã trước Tây Ban Nha với tỷ số 1-2. Nhà cựu vô địch EURO có quyền tiếc nuối vì những cơ hội bị bỏ lỡ. Tỷ lệ bàn thắng kỳ vọng (xG) họ tạo ra ở trận này là 1,09 - thống kê không hề tệ. Dù vậy, điều đó không thể che lấp được lỗ hổng lớn về sự sa sút của hàng tiền vệ thiếu sáng tạo.\n\nNhững thống kê không biết nói dối. Tiền đạo Randal Kolo Muani từ sau khi ghi bàn mở tỷ số trận đấu hoàn toàn lạc lõng trên hàng công. Nói cách khác, các tiền vệ của \"Les Bleus\" không tìm được sợi dây kết nối với cầu thủ đá cao nhất phía trên.',13,0,62,96,24,1,'active',NULL,NULL,'2024-07-10 16:09:42','2024-07-23 14:52:48',168,168,NULL,0,'21.06458','105.673676',NULL,NULL),(274,200,NULL,'KH000274','khách hàng 1','0948858123','',NULL,'male','','$2b$08$hMrIVvtzBEVUEkMEdlmmQuPlYgGT40Wc1AMGIekwFntYV2T8/uKES',120,NULL,NULL,'',NULL,'',0,0,NULL,NULL,NULL,1,'active',NULL,NULL,'2024-07-11 14:08:48','2024-07-11 14:08:48',178,NULL,NULL,0,'','',NULL,NULL),(275,194,NULL,'KH000275','test02','0325894123','test02@gmal.com','2024-07-13','female','','$2b$08$EnHNg/OW/6aoGd6fzHRHoe7ILEnDC3rc7ZEV3Ivcuo8yD5XioP9wi',118,NULL,NULL,'Quận Ba Đình,Thành Phố Hà Nội',NULL,'Trong công điện trưa nay, Thủ tướng Phạm Minh Chính gửi lời thăm hỏi, chia buồn tới thân nhân các gia đình có người bị nạn; yêu cầu Chủ tịch tỉnh Hà Giang phối hợp với tỉnh Cao Bằng chỉ đạo khắc phục nhanh hậu quả sạt lở, tìm kiếm nạn nhân, cứu chữa người bị thương; phối hợp với các địa phương lo hậu sự cho nạn nhân.\n\n\"Các cơ quan kiểm tra, đánh giá, xác định cụ thể nguyên nhân sạt lở để rút kinh nghiệm, tránh xảy ra sự cố tương tự, đặc biệt là vấn đề đảm bảo an toàn giao thông\", công điện nêu.Trong công điện trưa nay, Thủ tướng Phạm Minh Chính gửi lời thăm hỏi, chia buồn tới thân nhân các gia đình có người bị nạn; yêu cầu Chủ tịch tỉnh Hà Giang phối hợp với tỉnh Cao Bằng chỉ đạo khắc phục nhanh hậu quả sạt lở, tìm kiếm nạn nhân, cứu 